import Mapa from './Mapa';
import Chat from './chat';
import React, { useState, useEffect } from 'react';
import {io} from "socket.io-client";
import "./map.css";


function App() {
  const [socket, setSocket] = useState(false);
  const[usuario] = useState(false);
  useEffect(() => {
    const connect_socket = io("ws://tarea-3-websocket.2021-1.tallerdeintegracion.cl", {path: '/flights'});
    setSocket(connect_socket)
  }, []);

  if (socket){
    if (usuario){
      return (
        <div>    

          <div >

            <Chat id="chat" socket={socket}></Chat>
            <Mapa id="mapa" socket={socket}></Mapa>
          </div>


        }
        </div>

      );
    }
    else {
      return (
        <div>Hola aki estoy sin usuario</div>
      );
    }

  }
  else{return <div>Cargando...</div>}

}

export default App;
